<template>
    <div class="pdf">
        <div class="main_box">
            <div class="box">
                <div class="heading">
                    <h1>Certificaat</h1>
                </div>
                <div class="form">
                    <input v-model="message" v-on:keyup="charCount()" maxlength="24" placeholder="Wat is je naam?" data-v-ef68022e />
                    <button class="btn" @click="downloadPDF">Download Certificaat</button>
                </div>
            </div>
            <span>{{ totalcharacter }} / 24 letters</span>
        </div>
    </div>
</template>

<script>
    import jsPDF from 'jspdf'
    export default {

        name: 'pdf',
        data: function () {
            return {
                message: "",
                totalcharacter: 0
            }
        },

        methods: {

            charCount: function () {

                this.totalcharacter = this.message.length;
            },

            downloadPDF() {


                //initialize a new instance of jspdf
                var pdf = new jsPDF('landscape');

                //gets current date
                var today = new Date();
                //var date = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate();
                var date = today.getDate() + '-' + (today.getMonth() + 1) + '-' + today.getFullYear()

                // old image
                //var imgData = 'data:image/png;base64,'

                // new image, whole landscape a4 format
                var imgData = 'data:image/png;base64,'

                //adds image to pdf
                // last two parameters are necessary to keep it fast, will be a lot slower if not added
                pdf.addImage(imgData, 'png', 0, 0, 297, 210, '', 'FAST');


                //pdf.setFontSize(22);
                //pdf.text("Certificaat van geweldigheid", 100, 25);

                //pdf.setFontSize(12);
                //pdf.text("Uitgereikt aan", 125, 60);

                //add the date in the certificate
                pdf.setFontSize(26);
                pdf.text(date, 148, 135);

                pdf.setFontSize(30);
                //whatever text will be in the pdf (this.name refers to the v-model input)
                pdf.text(this.message, 80, 100);

                //save the pdf
                pdf.save('Certificaat.pdf');
            }

        }
    }
</script>

